import './App.css';
import Header from './components/Header';
import Button from './components/button';

const choiceStyle = {
  "width": document.getElementsByClassName("button")[0].width * 2 + 10
}

function App() {
  return (
    <div className="App">
      <Header title="Doodly"/>
      <div style={choiceStyle} className="choice">
        <Button title="New Canvas"/>
        <Button title="Load Canvas"/>
      </div>
    </div>
  );
}

export default App;
